import logo from "./logo.svg";

function App() {
  return (
    <div className="container bg-dark">
      <h1>FreysSupport - Développement en cours</h1>
      <p>
        Merci de votre visite, nous vous préviendrons quand le site sera
        disponible !
      </p>
    </div>
  );
}

export default App;
